import React from 'react';
import './BoardList.css';

const mockPosts = [
    { id: 1, title: '첫 글', author: '관리자', date:'2025-05-28'},
    { id: 2, title: '두번째 글', author: 'user1', date:'2025-05-27'}
];

const BoardList = () => {
    return (
        <div>
            <h1>POSTS</h1>
            <table className="board-table">
                <thead className="thead-light">
                    <tr>
                      
                        <th scope="col">Likes</th>
                        <th scope="col">Views</th>
                    </tr>
                </thead>
                <tbody>
                    <PostItem></PostItem>
                </tbody>
            </table>

            <a className="btn-primary" href="../">New</a>
        </div>
    )
}

const PostItem = () => {
    return (
        <div>
            <tr>
                <td>
                    <a>Title 1</a>
                </td>
                <td>
                    <span>Date</span>
                </td>
            </tr>
        </div>
    )
}

export default BoardList;
